(3977, 167, 'faq_title', 'Common <strong>Question</strong>'),
(3978, 167, '_faq_title', 'field_5b3397a093542'),
(3979, 167, 'faq_accordion_0_faq_question', 'What is an SMSF?'),
(3980, 167, '_faq_accordion_0_faq_question', 'field_5b31f926aa229'),
(3981, 167, 'faq_accordion_0_faq_answer', 'SMSF stands for Self Managed Super Fund where it provides an income at the time of retirement for all members associated with the fund. Also, it provides a death benefit coverage where the family members can get the after the death of any fund member. Every SMSF requires an own bank account, TFN (Tax File Number) and ABN (Australian Business Number) as well.'),
(3982, 167, '_faq_accordion_0_faq_answer', 'field_5b31f92daa22a'),
(3983, 167, 'faq_accordion_1_faq_question', 'Should I consider an SMSF?'),
(3984, 167, '_faq_accordion_1_faq_question', 'field_5b31f926aa229'),
(3985, 167, 'faq_accordion_1_faq_answer', 'SMSF secures your future with its preplanned financial protection. Future is uncertain to all of us. So an SMSF is the best way to secure it in advance.'),
(3986, 167, '_faq_accordion_1_faq_answer', 'field_5b31f92daa22a'),
(3987, 167, 'faq_accordion_2_faq_question', 'How much balance is required to set up an SMSF?'),
(3988, 167, '_faq_accordion_2_faq_question', 'field_5b31f926aa229'),
(3989, 167, 'faq_accordion_2_faq_answer', 'You can set up a self managed super fund within the range of $100000 to $200000. This kind of SMSF can give a tough competition to other conventional retail funds, but the trustees have to administrate and regulate the investment functions.'),
(3990, 167, '_faq_accordion_2_faq_answer', 'field_5b31f92daa22a'),
