(4635, 224, 'faq_title', 'Common <strong>Question</strong>'),
(4636, 224, '_faq_title', 'field_5b3397a093542'),
(4637, 224, 'faq_accordion_0_faq_question', 'What is an SMSF?'),
(4638, 224, '_faq_accordion_0_faq_question', 'field_5b31f926aa229'),
(4639, 224, 'faq_accordion_0_faq_answer', 'SMSF stands for Self Managed Super Fund where it provides an income at the time of retirement for all members associated with the fund. Also, it provides a death benefit coverage where the family members can get the after the death of any fund member. Every SMSF requires an own bank account, TFN (Tax File Number) and ABN (Australian Business Number) as well.'),
(4640, 224, '_faq_accordion_0_faq_answer', 'field_5b31f92daa22a'),
(4641, 224, 'faq_accordion_1_faq_question', 'Should I consider an SMSF?'),
(4642, 224, '_faq_accordion_1_faq_question', 'field_5b31f926aa229'),
(4643, 224, 'faq_accordion_1_faq_answer', 'SMSF secures your future with its preplanned financial protection. Future is uncertain to all of us. So an SMSF is the best way to secure it in advance.'),
(4644, 224, '_faq_accordion_1_faq_answer', 'field_5b31f92daa22a'),
(4645, 224, 'faq_accordion_2_faq_question', 'How much balance is required to set up an SMSF?'),
(4646, 224, '_faq_accordion_2_faq_question', 'field_5b31f926aa229'),
(4647, 224, 'faq_accordion_2_faq_answer', 'You can set up a self managed super fund within the range of $100000 to $200000. This kind of SMSF can give a tough competition to other conventional retail funds, but the trustees have to administrate and regulate the investment functions.'),
(4648, 224, '_faq_accordion_2_faq_answer', 'field_5b31f92daa22a'),
(4649, 224, 'faq_accordion', '3'),
(4650, 224, '_faq_accordion', 'field_5b31f919aa228'),
