(6114, 240, 'faq_accordion_0_faq_answer', 'SMSF stands for Self Managed Super Fund where it provides an income at the time of retirement for all members associated with the fund. Also, it provides a death benefit coverage where the family members can get the after the death of any fund member. Every SMSF requires an own bank account, TFN (Tax File Number) and ABN (Australian Business Number) as well.'),
(6115, 240, '_faq_accordion_0_faq_answer', 'field_5b31f92daa22a'),
(6116, 240, 'faq_accordion_1_faq_question', 'Should I consider an SMSF?'),
(6117, 240, '_faq_accordion_1_faq_question', 'field_5b31f926aa229'),
(6118, 240, 'faq_accordion_1_faq_answer', 'SMSF secures your future with its preplanned financial protection. Future is uncertain to all of us. So an SMSF is the best way to secure it in advance.'),
(6119, 240, '_faq_accordion_1_faq_answer', 'field_5b31f92daa22a'),
(6120, 240, 'faq_accordion_2_faq_question', 'How much balance is required to set up an SMSF?'),
