(6632, 251, '_testimonial_listing_1_testimonial_listing_author_pic', 'field_5b864e8fa01fb'),
(6633, 251, 'testimonial_listing_2_testimonial_listing_content', 'I have known Dinesh for over three years and I have found him to be highly proficient and professional in all of his SMSF Audit activities. Dinesh is approachable and he demonstrates a deep understanding of the SIS Act and ITAA Act requirements when auditing Funds and dealing with activities and investments.\r\n\r\nI have no reservations in recommending his services to other SMSF practitioners. He is by far the best auditor I have worked with over the last 10 years.'),
(6634, 251, '_testimonial_listing_2_testimonial_listing_content', 'field_5b864ddce4862'),
(6635, 251, 'testimonial_listing_2_testimonial_listing_from', '<strong>R.J</strong>May 2018'),
