(6638, 251, '_testimonial_listing_2_testimonial_listing_author_pic', 'field_5b864e8fa01fb'),
(6639, 251, 'testimonial_listing_3_testimonial_listing_content', 'I would highly recommend Dinesh for his thorough knowledge of Self-Managed Super Funds and its audits. Most often Dinesh is my first point of contact when I need help with anything. He is willing to share and helps others always. I wish him all the very best in life.'),
(6640, 251, '_testimonial_listing_3_testimonial_listing_content', 'field_5b864ddce4862'),
