(7018, 260, 'testimonial_listing_3_testimonial_listing_content', 'I would highly recommend Dinesh for his thorough knowledge of Self-Managed Super Funds and its audits. Most often Dinesh is my first point of contact when I need help with anything. He is willing to share and helps others always. I wish him all the very best in life.'),
