(8573, 278, 'faq_title', 'Common <strong>Question</strong>'),
(8574, 278, '_faq_title', 'field_5b3397a093542'),
(8575, 278, 'faq_accordion_0_faq_question', 'What is an SMSF?'),
(8576, 278, '_faq_accordion_0_faq_question', 'field_5b31f926aa229'),
(8577, 278, 'faq_accordion_0_faq_answer', 'SMSF stands for Self Managed Super Fund where it provides an income at the time of retirement for all members associated with the fund. Also, it provides a death benefit coverage where the family members can get the after the death of any fund member. Every SMSF requires an own bank account, TFN (Tax File Number) and ABN (Australian Business Number) as well.'),
(8578, 278, '_faq_accordion_0_faq_answer', 'field_5b31f92daa22a'),
(8579, 278, 'faq_accordion_1_faq_question', 'Should I consider an SMSF?'),
(8580, 278, '_faq_accordion_1_faq_question', 'field_5b31f926aa229'),
(8581, 278, 'faq_accordion_1_faq_answer', 'SMSF secures your future with its preplanned financial protection. Future is uncertain to all of us. So an SMSF is the best way to secure it in advance.'),
(8582, 278, '_faq_accordion_1_faq_answer', 'field_5b31f92daa22a'),
(8583, 278, 'faq_accordion_2_faq_question', 'How much balance is required to set up an SMSF?'),
(8584, 278, '_faq_accordion_2_faq_question', 'field_5b31f926aa229');
