(9021, 292, 'testimonial_listing_2_testimonial_listing_content', 'I have known Dinesh for over three years and I have found him to be highly proficient and professional in all of his SMSF Audit activities. Dinesh is approachable and he demonstrates a deep understanding of the SIS Act and ITAA Act requirements when auditing Funds and dealing with activities and investments.\r\n\r\nI have no reservations in recommending his services to other SMSF practitioners. He is by far the best auditor I have worked with over the last 10 years.'),
