(7, 1, '2018-06-25 09:37:07', '2018-06-25 09:37:07', '<h3><strong>What We Do... </strong></h3><p>Playgrounds today need to be constantly monitored & tested to ensure your play areas are up to code & specification. At PlayTest our inspectors go through stringent training and meet all the qualifications needed to ensure your play areas are inspected accurately and in the utmost professional manner. </p><p>Every effort should be made by playground best online paper editor providers to ensure that the surfacing around playgrounds never exceeds the maximum fall height , or  gmax > 200 , HIC values > 1000 or T1 -T2 < 3ms from the height which a user is expected to fall onto the surface.</p><p>Playtest can test your surface to AS 4422:2016 to show that the surface is compliant to the Critical Fall Height of the equipment.</p><p>PlayTest provide a written report and a certificate cheap law essay writing service with the Critical Fall Height printed at the top of the sheet with a photograph of your equipment as it should be set up.</p>', 'Home', '', 'publish', 'closed', 'closed', '', 'home', '', '', '2019-08-14 20:24:25', '2019-08-14 20:24:25', '', 0, 'http://arijteceimps-001-site1.btempurl.com/?page_id=7', 0, 'page', '', 0),
(8, 1, '2018-06-25 09:37:07', '2018-06-25 09:37:07', '', 'Home', '', 'inherit', 'closed', 'closed', '', '7-revision-v1', '', '', '2018-06-25 09:37:07', '2018-06-25 09:37:07', '', 7, 'http://arijteceimps-001-site1.btempurl.com/2018/06/25/7-revision-v1/', 0, 'revision', '', 0),
(9, 1, '2018-06-25 09:37:16', '2018-06-25 09:37:16', '<h2>PLAYTEST CAN TEST YOUR SURFACE TO (AS 4422:2016) TO SHOW THAT THE SURFACE IS COMPLIANT TO THE CRITICAL FALL HEIGHT OF THE EQUIPMENT.</h2>\r\n\r\nAs an independent Surface Testing Company operating scientific lab report format throughout Australasia, we specialise in the testing and assessment of all Playground and Sport surfaces.\r\n\r\nOur organisation Playtest Pty and Acousto-Scan are independent, and we place a strong emphasis on our integrity within the industry.\r\n\r\nWe have the capabilities to deal with any Playground Surface Testing, from Critical Fall height testing, failure investigation of the Rubber using Quality control procedures and Technical analysis of the components in the Laboratory.\r\n\r\nOur services are currently utilised by a number of Councils, Child Care centres, Independent Schools, Playground Companies, Surface Companies and Leisure Management Companies.\r\n\r\nMany of the surface construction companies great essay writers also draw upon our experience and knowledge in order to ensure the quality and durability of their products. (e.g. UV testing, TGA, DSC, SBR rubber, EPDM, TPV, TPE)\r\n\r\nPLAYTEST CAN TEST YOUR SURFACE TO (AS 4422:2016) TO SHOW THAT THE SURFACE IS COMPLIANT TO THE CRITICAL FALL HEIGHT OF THE EQUIPMENT.\r\n\r\nPlease browse our website to discover the full range of our services.\r\n\r\n<strong>PH 1300 88 4949 or Mobile +61 02 (0) 415 423334</strong>', 'About', '', 'publish', 'closed', 'closed', '', 'about', '', '', '2019-08-15 08:02:58', '2019-08-15 08:02:58', '', 0, 'http://arijteceimps-001-site1.btempurl.com/?page_id=9', 0, 'page', '', 0),
