(143, 1, '2018-06-30 05:31:07', '2018-06-30 05:31:07', '<h2>We are leading <strong>International Consulting</strong> firm specializing in financial investment.</h2>\r\n<p>At D.S Audit Services, we believe that auditors are the gatekeepers to the superannuation industry. \r\nSince 1 July 2013, only an approved auditor registered by ASIC is allowed to audit an SMSF. Once registered, the approved auditor must meet ongoing competency standards, undertake 120 hours of CPD over a 3-year period and comply with the independence requirements of APES 110. As auditors committed to facing the challenges of the future; we will take over your compliance requirements. </p>\r\n<p>D.S Audit Services has been providing SMSF Audit Services for numerous years in various different practices, being exposed to various levels of audits, from basic audits to the more complex audits including borrowing arrangements and in-house assets. D.S Audit Services have ASIC Registered SMSF auditors, which will remove independence concerns from your practice and consistently provide excellent service. \r\n</p>\r\n<p>Our auditors are also accredited with Australiaâ€™s superannuation industry body, SMSF Association, as an SMSF Specialist Auditor. A highly recognized and respected accreditation program. Our auditors are continuously improving their knowledge and raising the audit standards. </p>\r\n<p>D.S Audit Services is committed to maintaining a high-quality audit service at a reasonable price. Our audit fees will not cost you the earth and are comparable to the best in the industry. At D.S Audit Services, we believe that transparency is critical to maintaining an excellent working condition with all our clients.</p>', 'About', '', 'inherit', 'closed', 'closed', '', '9-revision-v1', '', '', '2018-06-30 05:31:07', '2018-06-30 05:31:07', '', 9, 'http://arijteceimps-001-site1.btempurl.com/9-revision-v1/', 0, 'revision', '', 0),
