(298, 1, '2018-09-05 12:08:14', '2018-09-05 12:08:14', '<h2>We are the leading <strong>International Consulting</strong> firm specialized in financial investment.</h2>\r\nAt D.S Audit Services, we believe that auditors are the gatekeepers to the superannuation industry.\r\nSince 1 July 2013, only an approved auditor registered by ASIC is allowed to audit an SMSF. Once registered, the approved auditor must meet ongoing competency standards, undertake 120 hours of CPD over a 3-year period and comply with the independence requirements of APES 110. As auditors committed to facing the challenges of the future; we will take over your compliance requirements.\r\n\r\nD.S Audit Services has been providing SMSF Audit Services for numerous years in various different practices, being exposed to various levels of audits, from basic audits to the more complex audits including borrowing arrangements and in-house assets. D.S Audit Services have ASIC Registered SMSF auditors, which will remove independence concerns from your practice and consistently provide excellent service.\r\n\r\nOur auditors are also accredited with Australiaâ€™s superannuation industry body, SMSF Association, as an SMSF Specialist Auditor. A highly recognized and respected accreditation program. Our auditors are continuously improving their knowledge and raising the audit standards.\r\n\r\nD.S Audit Services is committed to maintaining a high-quality audit service at a reasonable price. Our audit fees will not cost you the earth and are comparable to the best in the industry. At D.S Audit Services, we believe that transparency is critical to maintaining an excellent working condition with all our clients.', 'About', '', 'inherit', 'closed', 'closed', '', '9-revision-v1', '', '', '2018-09-05 12:08:14', '2018-09-05 12:08:14', '', 9, 'http://arijteceimps-001-site1.btempurl.com/9-revision-v1/', 0, 'revision', '', 0),
(299, 1, '2019-08-15 07:56:47', '2019-08-15 07:56:47', '<h2>Playtest can test your surface to AS 4422:2016 to show that the surface is compliant to the Critical Fall Height of the equipment.</h2>\n\nAs an independent Surface Testing Company operating scientific lab report format throughout Australasia, we specialise in the testing and assessment of all Playground and Sport surfaces.\n\nOur organisation Playtest Pty and Acousto-Scan are independent, and we place a strong emphasis on our integrity within the industry.\n\nWe have the capabilities to deal with any Playground Surface Testing, from Critical Fall height testing, failure investigation of the Rubber using Quality control procedures and Technical analysis of the components in the Laboratory.\n\nOur services are currently utilised by a number of Councils, Child Care centres, Independent Schools, Playground Companies, Surface Companies and Leisure Management Companies.\n\nMany of the surface construction companies great essay writers also draw upon our experience and knowledge in order to ensure the quality and durability of their products. (e.g. UV testing, TGA, DSC, SBR rubber, EPDM, TPV, TPE)\n\nPlease browse our website to discover the full range of our services.\n\nPH 1300 88 4949 or Mobile +61 02 (0) 415 423334', 'About', '', 'inherit', 'closed', 'closed', '', '9-autosave-v1', '', '', '2019-08-15 07:56:47', '2019-08-15 07:56:47', '', 9, 'http://arijteceimps-001-site1.btempurl.com/9-autosave-v1/', 0, 'revision', '', 0),
