(476, 1, '2018-09-14 12:27:10', '2018-09-14 12:27:10', '<h2>The Drop Test (Impact Attenuation Testing)</h2>\r\nEvidence of adequate playground surfacing may be required for the licensing processes of Education and Care Services. A drop test will determine if the playground surfacing is continuing to cushion the impact of a fall from the equipment provided in the playground.\r\n\r\nA drop test is usually conducted for solid playground surfaces. Loose fill surfaces installed in playgrounds need to be maintained to appropriate minimum depth to ensure ongoing compliance with the Australian Standard (check the test results of the loose fill product for the minimum depths 200mm). A drop test may be recommended following installation of the solid playground surfacing to confirm that the installation meets the critical fall height rating in accordance with the Australian Standard.\r\n\r\nPlaytest and Acoustoscan are NATA certified to test to AS4422 and all equipment is  calibrated to Australian/New Zealand Standard AS/NZS 4422 and can provide documentation as evidence of calibration to the Australian Standard.\r\n\r\nWhat is Playground Surfacing?\r\n\r\nPlayground surfacing is a soft impact attenuating material surrounding playground equipment where falls are possible within the fall zone. The provision of adequate playground surfacing will minimise the incidence and severity of head injury.\r\n\r\nTypes of Playground Surfacing\r\n\r\nLoose fill includes products such as bark mulch, wood chips, wood fibre, rubber mulch, grape seed and sand. The cushioning effect of loose fill is achieved by the trapping of air between particles.\r\n\r\nSolid material (polymeric) includes products best writing service argumentative essays such as synthetic grass, rubber tiles and wet pour rubber. The qualities of solid materials vary according to the thickness of the layer and the composition of the material. There is always a wear layer and impact layer under the solid surface.', 'Child Care Centres and Schools', 'Early Learning Centre, Long Day Care, OOSH, Family Day Care,<br/>\r\nOccasional Care & In-Home Care Schools', 'publish', 'closed', 'closed', '', 'child-care-centres', '', '', '2019-08-14 20:20:46', '2019-08-14 20:20:46', '', 0, 'http://arijteceimps-001-site1.btempurl.com/?post_type=service&#038;p=476', 0, 'service', '', 0),
(478, 1, '2018-09-14 12:30:10', '2018-09-14 12:30:10', '<h2>The Drop Test (Impact Attenuation Testing)</h2>\r\nLocal Parks, Playgrounds, and  Community Centres can benefit from the knowledge that there surfaces in the playground are compliant to AS4422 Australian Standard\r\n\r\nThe critical fall height of the surface proofread my paper free online needs to be adequate for the Fall height of the equipment or of the equipment that will be setup in the area.\r\n\r\nLocal Playground surfacing will be installed with a surface that complies to the fall height of the equipment. \r\n\r\nImpact testing of the Surface is required every three years as in AS4685.0:2017 and AS4422.2016. If it is installed correctly, and you have a report from the supplier that it will attain a critical fall height that is higher than the equipment.\r\n\r\nPlaytest can test the surface for you in-situ so you have peace of mind that it will be compliance for the local playground.\r\n\r\nNew playgrounds can be tested after the installation and before the fence is removed around the playground equipment.', 'Councils', 'Local Parks, Playgrounds & Community Centres.', 'publish', 'closed', 'closed', '', 'councils', '', '', '2019-08-14 20:19:33', '2019-08-14 20:19:33', '', 0, 'http://arijteceimps-001-site1.btempurl.com/?post_type=service&#038;p=478', 0, 'service', '', 0),
(481, 1, '2019-08-14 20:21:37', '2019-08-14 20:21:37', 'Testing of your product before manufacture and installation is important for the proof of compliance to Australians Standard. Before you start manufacturing your product you need to know what critical fall height your product will attain. This is a Laboratory test to determine the Product statement for the surface .\n\nContact Acousto-Scan Pty Ltd to get your products tested.\n\nThe manufacturer can then show this Product statement to customers so they know what they are getting for there money. This is important to know as this critical fall height will vary between different thickness surface giving different fall heights.\n\nIt is important to have a graph, which shows the critical fall height against the thickness of the polymeric material you are selling. So a 50mm thick SBR rubber with wear layer will achieve a fall height of  1.5-2m depending on density. Or a 25mm thick SBR rubber only will achieve  0.8 -1.0m CFH.\n\nWhen you have the product statement you can install the surface you are selling without an onsite test as you have traceability to the national standards through the product report for that thickness. As long as the product installed is the same,  the results will be the same, or higher than the laboratory test.\n\nThe lab test is performed on concrete , and most parks are laid on sub base . The sub base material can give 100-200mm increase in the fall height for the same product that was tested on 300mm thick concrete.\n\nThe laboratory testing will involve several different thickness  surface to generate the CFH graph for that product.', 'COMMERCIAL CUSTOMERS', 'Manufacturers , Installers, Suppliers', 'inherit', 'closed', 'closed', '', '472-autosave-v1', '', '', '2019-08-14 20:21:37', '2019-08-14 20:21:37', '', 472, 'http://arijteceimps-001-site1.btempurl.com/472-autosave-v1/', 0, 'revision', '', 0),
