(520, 1, '2018-10-09 10:22:25', '2018-10-09 10:22:25', '<h2>Eiffe Builders have been building quality homes and commercial projects since 1987.</h2>\r\n\r\nBrian and his particular approach to the building process are renowned across Brisbane, particularly in riverfront suburbs. Many waterfront views are enjoyed from Eiffe-built kitchens, decks and bedrooms and there are many owner-occupiers and developers who now work exclusively with Brian on their next projects because the Eiffe process results in testimonials like this:\r\n\r\n“When you want a builder who genuinely cares, use Brian. I have used 4 different builders for the houses I have built and I would use Brian again anytime.”\r\n\r\n<em>Lana Johnston</em>\r\n\r\nBrian is direct and forthright, and values client relationships over profit. His approach to a sale is to ensure that you are fully aware of what you’ll get in the finished product for your budget, so that you don’t suffer a moment of doubt once you commit to the project.\r\n\r\nBrian’s team is carefully selected from amongst the quality tradesmen he has met over the last three decades of building. Each is a specialist in his or her field and you will appreciate the quality of their expertise when you open the door to your new home or enjoy your new commercial premises.\r\n\r\nAlthough you will use one of our designs or supply your own, it’s the little touches from each specialist acting under Brian’s care that make an Eiffe home special.\r\n\r\nEiffe Builders is a HIA member and the company prides itself on upholding the values of the HIA, particularly in developing sustainable living environments that capture the best of South East Queensland’s superb climate.\r\n\r\nBrian and his team can build:\r\n\r\n<ul>\r\n<li>New homes</li>\r\n<li>Renovations</li>\r\n<li>Extensions</li>\r\n<li>Patios and decks</li>\r\n<li>Commercial Premises and Extensions</li>\r\n</ul>\r\n\r\nWe look forward to talking with you about your building project.', 'About', '', 'inherit', 'closed', 'closed', '', '9-revision-v1', '', '', '2018-10-09 10:22:25', '2018-10-09 10:22:25', '', 9, 'http://arijteceimps-001-site1.btempurl.com/9-revision-v1/', 0, 'revision', '', 0),
